window.bookSummaryJSON = "<p><b>Waking up alone. </b></p> <p>Ellie Masters comes out of a coma to find herself the only inhabitant of an eerily empty moon station. She’s not on Earth any more; she’s not even in the right solar system. So when someone reaches out to her, tells her he’s her friend, she’s happy to believe it. The alternative is to be stuck alone with an enemy.</p> <p><b>The hunt of his career. </b></p> <p>Grih Battle Center captain, Renn Sorvihn, has been chasing a rogue Tecran ship for over a month, convinced its captain is simply trying to delay his inevitable surrender and punishment. But when Renn follows the Tecran ship into an uncharted sector, and realizes the Tecran have been working their way to a secret moon base for weeks, he suddenly understands things are most definitely not as they seem.</p> <p><b>Caught in the crossfire. </b></p> <p>When the Tecran arrive, with the Grih hot on their heels, Ellie finds herself the catalyst for heightened danger to everyone. The Tecran see her as evidence of their military’s crimes, the Grih see her as a massive diplomatic complication, and her presence brings the whole confrontation up several thousand notches.</p> <p>But Ellie isn’t alone, and her new friend has ways to help her. Time to outclass them all....</p>"; 
